import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";


// "props (which stands for propertties). react props are like function arguments in javascript."

const App = () => (
    <>
        <h1 className="heading_style"> List Of Top Six Amazon Prime  Series</h1>
        {Sdata.map((val, index) => {
            return (
                <Card
                    key={val.id}
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    link={val.links}
                />
            );
        })}
    </>

);

export default App;
